import React, { Component } from "react";
import { Link } from "react-router-dom";

import { login } from '../functions/login'

class SignInForm extends Component {
  constructor() {
    super();

    this.state = {
      codeEncrypted: "",
      codeDecrypted: ""
    };

    this.handleChange = this.handleChange.bind(this);
  }

  getEncryptedData() {
    fetch('')
    .then((response) => response.json())
    .then(codeEncrypted => {
        this.setState({ codeEncrypted: codeEncrypted });
    });

}

  handleChange(event) {
    let target = event.target;
    let value = target.type === "checkbox" ? target.checked : target.value;
    let name = target.name;

    this.setState({
      [name]: value
    });
  }

  render() {
    return (
      <div className="formCenter">
        <form className="formFields" onSubmit={this.handleSubmit}>
          <div className="formField">
            <label className="formFieldTitleRight">
              Code Generator
            </label>
            <label className="formFieldTitleRightSubtitle">
              Note that it may take a few seconds to load...
            </label>
            <label className="formFieldLabel">
              Code Encrypted
            </label>
            <input
              type="name-input"
              id="email"
              className="formFieldInput"
              placeholder="Here will be displayed your encrypted code"
              name="email"
              value={this.state.codeEncrypted}
            />
          </div>

          <div className="formField">
            <label className="formFieldLabel">
              Code Decrypted
            </label>
            <input
              type="name-input"
              id="password"
              className="formFieldInput"
              placeholder="Here will be displayed your decrypted code"
              name="password"
              value={this.state.codeDecrypted}
            />
          </div>

          <div className="formField">
            <button onClick={login} className="formFieldButton">Get Code</button>{" "}
          </div>
        </form>
      </div>
    );
  }
}

export default SignInForm;
